import React, {Component} from 'react';
import './HomePage.css';

class HomePage extends Component{

    render(){
        return(
            <div className="homepage">
                <p><span className="supra">SUPRA</span><span className="cine">CINE</span></p>
            </div>
        );
    }
}

export default HomePage;
